@Override
public String toString(String field) {
  final StringBuilder sb = new StringBuilder();
  sb.append(getClass().getSimpleName());
  sb.append(':');
  if (this.field.equals(field) == false) {
    sb.append("field=");
    sb.append(this.field);
    sb.append(':');
  }

  return sb.append(" Lower Left: [")
      .append(minLon)
      .append(',')
      .append(minLat)
      .append(']')
      .append(" Upper Right: [")
      .append(maxLon)
      .append(',')
      .append(maxLat)
      .append("]")
      .toString();
}

